The number one reason that we eat unhealthy is because we get too busy to make healthy choices. I keep waiting for life to get less busy... but I’ve been waiting a long time & am realizing this is just how life is! 🤪  A few months ago I stumbled across @GilbertsCraftSausages at my local grocery store & was blown away by...

• the taste {they come in LOTS of yummy flavors}
• the quality {all natural + antibiotic free}
• the convenience {individually wrapped & fully cooked}

We use them all the time in dinner meals, but for me, they really shine at lunchtime, because they’re individually wrapped & fully cooked! I just heat them up & enjoy them in a wrap or on a salad (or just by themself)! 

To get more info & recipe ideas for #GilbertsChickenSausage head to → www.gilbertssausages.com & be sure to pick some up the next time you head to the grocery store! And do yourself a favor & grab the “Aloha” flavor... it’s AMAZING!!! 🤤

-recipes-

SHEET PAN DINNER | Preheat oven to 425°, chop up veggies (choose any you like), slice up Gilbert’s sausage (whichever flavor you want), toss on sheet pan, drizzle with olive oil, season with salt, pepper & dried rosemary, bake for 30 minutes (or until everything is fork tender! YUMMMM

CHICKEN SAUSAGE WRAP | Slice up Gilbert’s sausage (whichever flavor you like), softly heat tortilla (I use gluten free), lay mixed greens on tortilla, place sausage on top, sprinkle with cheese (optional), drizzle with honey mustard & that’s a wrap! 😅 

